import React, {useState} from "react";

const SignUp =()=>{
    return(
        <div >
            <h1>Register</h1>
            <input className="inputBox" type ="text" placeholder="Enter Name" /><br/>
            <input className="inputBox" type ="email" placeholder="Enter Email" /><br/>
            <input className="inputBox" type ="password" placeholder="Enter Password" /><br/>
            <button className="appButton" type ="button" > Sign Up </button>
        </div>
    )
}

export default SignUp;
